    <script>
      !(function () {
        const P = (k) => "cell2Nick:" + k;
        let last = "";
        const f = () => {
          const i = document.querySelector("#primary-inputs input#name");
          if (!i || i.dataset.cell2) return;
          i.dataset.cell2 = 1;
          const j = i.cloneNode(!0);
          j.placeholder = "Cell 2 nickname";
          j.style.marginLeft = "6px";
          const norm = (s) => (typeof s === "string" && s.length ? s : "");
          const apply = () =>
            queueMicrotask(() => {
              const a = norm(i.value);
              if (!a || a === last) return;
              last = a;
              const b = norm(localStorage.getItem(P(a)) || a + "-2");
              j.value = b;
              window.__connNicks = [a, b];
            });
          j.oninput = () => {
            const a = norm(i.value);
            const b = norm(j.value);
            if (!a || !b) return;
            localStorage.setItem(P(a), b);
            window.__connNicks = [a, b];
          };
          i.parentNode.appendChild(j);
          setInterval(apply, 150);
          apply();
        };
        new MutationObserver(f).observe(document.body, {
          childList: !0,
          subtree: !0,
        });
      })();
